// import Home from "./Components/Home";
import Navbar from "./Components/Navbar";
import Form from './Components/Test/Form'
import Mailer from './Components/Test/nodeMailer'

const App = () => {

  return (
    <fragment className="App">
      <Router>
        <Navbar /> 
        <hr />
        <Favourites /> 
        <Form />
        <Mailer />
      </Router>
    </fragment>
  );
};

export default App;
